class AudioManager {
  constructor() {
    const messageComeAudio = document.createElement("audio");
    messageComeAudio.id = "audio_message_come_id";
    // messageComeAudio.src = 'http://downsc.chinaz.net/Files/DownLoad/sound1/201711/9478.wav'
    messageComeAudio.src =
      "data:audio/wav;base64,";

    // '../assets/9478.wav'
    messageComeAudio.style.display = "none";
    document.body.appendChild(messageComeAudio);
    this.messageComeAudio = messageComeAudio;

    const newPersonComeAudio = document.createElement("video");
    newPersonComeAudio.id = "audio_new_person_come_id";
    // newPersonComeAudio.src = '../assets/4230.wav'
    newPersonComeAudio.src =
      "data:audio/wav;base64,";
    // newPersonComeAudio.src = 'http://downsc.chinaz.net/files/download/sound1/201403/4230.wav'
    newPersonComeAudio.style.display = "none";
    document.body.appendChild(newPersonComeAudio);
    this.newPersonComeAudio = newPersonComeAudio;
    this.newPersonComeAudio.loop = true;
  }

  init() {
    console.log("init audio");
  }

  playMessageComeAudio() {
    this.messageComeAudio.play();
  }

  playNewComeAudio() {
    // 
    if (!this.newPersonComeAudio.paused) {
      return;
    }
    this.newPersonComeAudio.currentTime = 0;
    this.newPersonComeAudio.play();
    setTimeout(() => {
      this.newPersonComeAudio.pause();
    }, 30 * 1000);
  }

  pauseNewComeAudio() {
    if (!this.newPersonComeAudio.paused) {
      this.newPersonComeAudio.pause();
    }
  }
}

const audioManager = new AudioManager();
export default audioManager;
